import styled from "styled-components";
import React, { useContext } from "react";
import { AppContext } from "../context/context";
import { AuthContext } from "../context/AuthContext";
import { Card } from "../components/defaultComponents";

function Dashboard(props) {
  const user = useContext(AuthContext).authState.userInfo;
  const { setShowHeader, setShowNavbar } = React.useContext(AppContext);
  setShowHeader(true);
  setShowNavbar(true);
  return (
    <Wrapper>
      <GreetingsCard>
        <h1>Buna {user.nume}</h1>
      </GreetingsCard>
      <div className="graphCardsContainers">
        <GraphCard></GraphCard>
        <GraphInputCard></GraphInputCard>
      </div>
    </Wrapper>
  );
}
const GraphInputCard = styled(Card)`
  width: 100%;
`;
const GraphCard = styled(Card)`
  width: 100%;
`;
const GreetingsCard = styled(Card)`
  width: 100%;
  h1 {
    font-weight: normal;
    font-size: 2rem;
  }
  margin-bottom: 1rem;
`;

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  margin-left: 20vw;
  margin-top: 20vh;
  margin-right: 10vw;
  align-items: center;
  justify-content: center;
  font-size: 1rem;

  .graphCardsContainer {
  }
`;

export default Dashboard;
